import React from 'react'
import MinyCard from '../MinyCard';

export default function AllCards(props) {
    const { dataCard } = props;
    return (
        <div key={elem.categoryId}>
              {elem.categoryId ? (
                  <div className="allCards">
                    {dataCard.map((elem) => {
                      if (elem.categoryId) {
                        dataCard.filter((i) => {
                          return i.category === elem.category;
                        });
                        return <div>  <MinyCard  /></div>;
                      }
                    })}
                  </div>
                ) : null}
        </div>
    )
}
